import React from 'react';
import Main from "./content/Main/Main";
import { Switch, Route} from 'react-router-dom'
import CurrentMusic from './content/CurrentMusic/CurrentMusic'
import SignUp from './content/Sign Up/SignUp'
import LogIn from './content/Log In/LogIn'
import UploadMusic from './content/UploadMusic/UploadMusic';


class App extends React.Component{
    state = { // State
      songs: [
          {name: 'song1', duration: '2:32', fileName: '../StaticMusic/first.mp3'},
          {name: 'song2', duration: '1:56', fileName: '../StaticMusic/second.mp3'},
          {name: 'song3', duration: '3:23', fileName: '../StaticMusic/third.mp3'},
          {name: 'song4', duration: '2:20', fileName: '../StaticMusic/fourth.mp3'},
          {name: 'song5', duration: '1:23', fileName: '../StaticMusic/fifth.mp3'}
      ],
      songSrcKeys: [
        {src: 'fcddaf58'},
        {src: '77b22ae8'},
        {src: 'c5dff8f2'},
        {src: '6f932147'},
        {src: 'ca566daa'}
      ]
  }
  render(){
  return (
    <>
      <Switch>
        <Route exact path="/">
          <Main songinfo={this.state.songs}/>
        </Route>
        <Route path="/current" >
          <CurrentMusic songinfo={this.state.songs} songkeys={this.state.songSrcKeys}/>
        </Route>
        <Route path="/signup" component={SignUp} />
        <Route path="/signin"  component={LogIn} />
        <Route path="/upload" component={UploadMusic} />
      </Switch>
    </>
  )
  }
}

export default App;
